tests.code:
// This is a special case because multiple k6 tests need to be run for one test.
const testDir = path.join(__dirname, '..', 'k6_tests', 'slt_tests', 'multi_part_tests', 'spike');
// Scale the single workspaces to find a count of max workspaces
const output1 = path.join(systemOutput, 'max_one_user_workspaces_test.json');
await I.runK6Test(`${testDir}/max_one_user_workspaces_test.js`, [`--summary-export=${output1}`], {stdio: 'inherit'});
// Grab the results from the outputted file
const result = require(output1);
const numOfWorkspaces = _.get(result, ['metrics', 'joined_workspaces', 'count']);
if (!numOfWorkspaces) {
  throw Error(
    'K6 failed to have any users join a workspace in the single workspace setup. Consider increasing your scaling time, or lowering the number of k6 users.'
  );
}
process.env.K6_MAX_WORKSPACES = numOfWorkspaces;
I.say(`Setting Max Workspaces to ${numOfWorkspaces}`);
const {workspaceIds} = await setupK6Env(setupEnv, codeceptjs.config.get('bluescapeUrl'), numOfWorkspaces);
expect(workspaceIds).toHaveLength(numOfWorkspaces);
const output2 = path.join(systemOutput, 'max_two_user_workspaces_test.json');
await I.runK6Test(`${testDir}/max_two_user_workspaces_test.js`, [`--summary-export=${output2}`], {stdio: 'inherit'});

